import React from 'react';
import './AYATab.css';



class AYATab extends React.Component{
    constructor(props){
        super(props);
    }



    render(){
        const name = localStorage.getItem('playername');
        const matchdate = localStorage.getItem('matchdate')
        return(
            <div>
        <div>{name}</div>
        <div>{matchdate}</div>
        </div>
        );
    }
}

export default AYATab;
